import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        <h1>Original Pokemon</h1>
        <h3>Fire Type</h3>
        <ul>
        </ul>
        <hr/>
        <h3>Water Type</h3>
        <h3>Grass Type</h3>
      </div>
    );
  }
}

export default App;
